#include <stdio.h>
#define int long long
signed main()
{
	int n;
	scanf("%lld",&n);
	for(int i=1;i<=n;i++)
	{
		int a,b,c,s=0;
		scanf("%lld%lld%lld",&a,&b,&c);
		int l=1,r=a,mid;
		while(l<=r)
		{
			mid=(l+r)/2;
			s=a*c;
			if(mid<=b)
			{
				if((long long)2*mid*mid*c==s*b)
	     		{
					printf("YES\n");
					break;
				}
				else if((long long)2*mid*mid*c<s*b)
			    l=mid+1;
				else 
				r=mid-1;

			}
			else
			{
				if((int)2*(a-mid)*(a-mid)*c==s*(a-b))
				{
					printf("YES\n");
					break;
				}
				else if((int)2*(a-mid)*(a-mid)*c<s*(a-b))
				r=mid-1;
				else
				l=mid+1;
			}
		}
		if(l>r)
		printf("NO\n");
		}
		return 0;
}

