	for(i=0;i<n;i++)
	{
		for(j=0;j<3;j++){
			scanf("%d",&a[i][j]);
		}
		s1=0.5*a[i][0]*a[i][2];
		s2=0.5*a[i][1]*a[i][2];
		if(s2>=0.5*s1){
			for(k=1;k<=a[i][1];k++){
				s3=0.5*k*k*a[i][2]/a[i][1];
				if(s3==0.5*s1){
					printf("YES\n");
					break;
				} 
			}
			if(k>a[i][1]){
				printf("NO\n");
			}
		}
		else{
			for(k=a[i][1]+1;k<=a[i][0];k++){
				s3=0.5*(a[i][0]-k)*(k-a[i][0])*a[i][2]/(a[i][1]-a[i][0]);
				if(s3==0.5*s1){
					printf("YES\n");
					break;
				} 
			}
			if(k>a[i][0]){
					printf("NO\n");
				}
			}
		}
	return 0;
}

