    scanf("%d", &t);
    while (t--) {
        scanf("%d %d %d", &a, &b, &c);
        s1 = a * c / 2.0;
        if (b == a / 2.0) {
            printf("YES\n");
            continue;
        } else if (b > a / 2.0) {
            for (i = 1; i < b; i++) {
                h = c * i * 1.0 / b;
                s2 = i * h / 2;
                if (s2 == s1 / 2) {
                    printf("YES\n");
                    break;
                }
            }
            if (i != b)
                continue;
        } else {
            for (i = b + 1; i < a; i++) {
                h = c * (a - i) * 1.0 / (a - b);
                s2 = (a - i) * h / 2;
                if (s2 == s1 / 2) {
                    printf("YES\n");
                    break;
                }
            }
            if (i != a)
                continue;
        }
        printf("NO\n");
    }
    return 0;
}

