    scanf("%d",&T);
    while(T){
        T--;
        int flag=0;
        int xb,xc,yc;
        scanf("%d%d%d",&xb,&xc,&yc);
        double x1=sqrt(xb*xc/2);
        int x=(int)x1;
        if(x1<=xc&&x1==x){
            printf("YES\n");
            flag=1;
        }
        double x2=xb-sqrt(xb*(xb-xc)/2);
        int y=(int)x2;
        if(x2>xc&&x2==y){
            printf("YES\n");
            flag=1;
        }
        if(flag==0){
            printf("NO\n");
        }
    }

    return 0;
}

