#include<math.h>
int main() {
  long long x_b, x_c, y_c;
  int t;
  scanf("%d", &t);
  while (t--) {
    scanf("%lld%lld%lld", &x_b, &x_c, &y_c);
    long long s = x_b * y_c;
    if (x_c * 2 < x_b) x_c = x_b - x_c;
    double x = sqrt((double) s * x_c / 2 * y_c);
    if (x == (int)x) puts("YES");
    else puts("NO");
  }
  return 0;
}

