#include<stdio.h>
int main()
{
    int T;
    scanf("%d",&T);
    int i,j,a,b,c;
    for(i=0;i<T;i++)
    {
        scanf("%d%d%d",&a,&b,&c);
        for(j=0;j<a;j++)
        {
            if(2*(a-j)*(a-j)==a*(a-b))
                break;
        }
        if(j<a)
            printf("YES\n");
        else printf("NO\n");
    }
    return 0;
}

