int main()
{
    int t = 0, b = 0, c = 0, y = 0, x0 = 0, tag = 0, s = 0, s1 = 0;
    scanf("%d", &t);

    while (t-- > 0)
    {
        tag = 0;
        scanf("%d %d %d", &b, &c, &y); 
        while (tag == 0)
        {   
            //防止出现小数影响判断
            s = b * y;
            //当b为c的两倍时，由于c为整数，所以x=c即可满足题意
            if((double)b / 2 == c)
            {   
                printf("YES\n");
                tag = 1;
            }
            //当b/2小于c时能平分三角形的x必定在b/2的右边，c的左边
            else if(b / 2 < c)
            {   
                for (int i = 1; i + b / 2 < c && tag == 0; i++)
                {   //面积等于底*底*高*2
                    s1 = (b / 2 + i) * 2 * (b / 2 + i) * y / c ;
                    if(s1 == s)
                    {   
                        printf("YES\n");
                        tag = 1;
                     }  
                }
                //当未找到合适的x时输出no
                if(!tag)
                {   
                    printf("NO\n");
                    tag = 1;
                }
            }
            //当b/2大于c时能平分三角形的x必定在b/2的左边，c的右边
            else
            {
                for (int i = 0; c < (b - b / 2 - i) && tag == 0; i++)
                {   
                    s1 = (b / 2 + i) * 2 * (b / 2 + i) * y / (b - c) ;
                    if(s1 == s)
                    {   
                        printf("YES\n");
                        tag = 1;
                     }
                }
                if(!tag)
                {   
                    printf("NO\n");
                    tag = 1;
                }
            }
        }   
    }
}

