#include<stdio.h>

int main()
{
    //s1代表左边的面积，s2代表右边的面积
    double s1=0.0,s2=0.0;
    int xb=0,xc=0,yc=0,t=0;
    int x0=0,T=0;
    scanf("%d",&T);
    while(T!=0)
    {
    t=0;
    //输入坐标
    scanf("%d%d%d",&xb,&xc,&yc);
    if(xc<0||xc>=xb||yc<0)
    {
        //不符合时直接退出
        exit(-1);
    }
    for(x0=1;x0<xb;x0++)
    {
        if(x0<xc)
        {
           //此时左边面积是一个三角形，右边面积是一个梯形 
           s1=1.0/2*(x0)*(yc*1.0/xc)*x0;
           s2=1.0/2*(yc*1.0/xc*x0+yc)*(xc-x0)+1.0/2*(xb-xc)*yc;
           //printf("%lf %lf\n",s1,s2);
           if(s1==s2)
           {
               t=1;
               //printf("YES\n");
               break;
           }
        }else if(x0==xc)
        {
            //此时左右两边面积都为三角形
            s1=1.0/2*(x0)*yc;
            s2=1.0/2*(xb-x0)*yc;
            //printf(".%lf %lf\n",s1,s2);
            if(s1==s2)
            {
                t=1;
                //printf("YES\n");
                break;
            }
        }else if(x0>xc)
        {
           //此时左边面积为三角形加梯形，右边为三角形
           s1=1.0/2*(xc)*yc+1.0/2*(yc+yc*1.0/(xc-xb)*(x0-xb))*(x0-xc);
           s2=1.0/2*(xb-x0)*(yc*1.0/(xc-xb)*(x0-xb));
           //printf(",%lf %lf\n",s1,s2);
           if(s1==s2)
           {
               t=1;
               break;
           }
        }
    }
        if(t==1)
        {
            printf("YES\n");
        }else
        {
            printf("NO\n");
        }
        //减少次数
        T--;
    }
    return 0;
}
